[center]Verenigde Staten
Documentaire
92 minuten


geregisseerd door Louie Psihoyos
met Richard O'Barry


Al sinds TV-held Flipper zijn dolfijnen populair en geliefd bij het grote publiek. Met als gevolg een steeds groter wordende trek in de dolfijnen als toeristische attractie, om zien kunstjes te doen of om mee te zwemmen, met als gevolg een multi-miljoenen-industrie en de bedreiging van de diersoort zelf. Het stadje Taijii in Japan herbergt de grootste toeleverancier van dolfijnen in de wereld, maar niemand weet of krijgt toegang tot wat er daar nu werkelijk gebeurt in die dolfijnenbaai. Gewapend met ultramoderne apparatuur en befaamd dolfijnentrainer Richard O'Barry probeert het docu-team dit ondoordringbare gebied binnen te dringen. Met als gevolg schokkende resultaten...



